import React from 'react'
import { AppBar, Box, Toolbar, Typography, Button } from '@mui/material'
import { NavLink } from 'react-router-dom'
import { getToken } from '../services/LocalStorage'

const Navbar=()=> {
    const token= getToken('token')
  return (
   <Box sx={{flexGrow:3}}>
    <AppBar position='static' color='primary'>
        <Toolbar>
            <Typography fontSize='22px' fontFamily='forte' component="div" sx={{flexGrow:1}}>
                Auth-Web-App
            </Typography>

            <Button component={NavLink} to='/' style={({isActive})=>{return{backgroundColor: isActive ? 'darkblue' : ''}}} sx={{color:'white' , fontFamily:'serif', fontSize:'20px', textTransform: 'none'}}>Home </Button>

            {token ?  <Button component={NavLink} to='/dashboard' style={({isActive})=>{return{backgroundColor: isActive ? 'darkblue' : ''}}} sx={{color:'white', fontFamily:'serif', fontSize:'20px', textTransform: 'none' }}>Dashboard</Button> : 
             <Button component={NavLink} to='/LogReg' style={({isActive})=>{return{backgroundColor: isActive ? 'darkblue' : ''}}} sx={{color:'white', fontFamily:'serif', fontSize:'20px', textTransform: 'none' }}>Sign-in </Button>}

           
        </Toolbar>
    </AppBar>
   </Box>
  );
}

export default Navbar;
